//import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <title>Login Page</title>
        <h1>Login</h1>
        <body>
            <h3>
                <form>
                    <input type="text" id="email" placeholder="email"/><br/>
                    <input type="text" id="password" placeholder="password"/><br/>
                    <input type="submit" value="submit"/><br/>
                    <button class="register" type="button" onclick="window.location='register.html'">Dont have an account?</button>
                </form>
            </h3>
      </body>
      </header>
    </div>
  );
}

export default App;
